import itertools

grid = []

def main():
	m = map_.split("\n")
	for line in m:
		process(line)
	analyse_results()

def process(inp):
	grid.append(list(inp))

def analyse_results():
	l = len(grid)
	num_regions = 0
	for (x,y) in itertools.product(range(l),range(l)):
		if grid[x][y] == "#":
			flood_fill((x,y))
			for (i,j) in itertools.product(range(l),range(l)):
				if grid[i][j] == "o":
					grid[i][j] = "."
			num_regions += 1
			print (x,y), num_regions

def flood_fill(pt):
	i,j = pt
	adj = [(1,0),(-1,0),(0,1),(0,-1)]
	for (x,y) in adj:
		if verify_coords(i+x,j+y):
			g = grid[i+x][j+y]
			if g == '#':
				grid[i+x][j+y] = 'o'
				flood_fill((i+x,j+y))

def verify_coords(i,j):
	return (i in range(len(grid))) and (j in range(len(grid)))

